import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';

function SigninScreen(props){

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const dispatch = useDispatch();

  useEffect(() =>{
    return () => {
      //
    };
  }, []);

  const submitHandler = (e) =>{
    e.preventDefault();
  }

  return(
    <div className="form">
      <form onSubmit={submitHandler}>
        <ul className="form-container">
          <li>
            <label for="email">
              Email:
            </label>
              <input type="email" name="email" id="email" onChange={()=>setEmail(event.target.value)} />
          </li>
          <li>
            <label for="password">
              Password:
            </label>
            <input type="password" name="password" id="password" onChange={()=>setPassword(event.target.value)} />
          </li>
          <li>
            <button type="submit" className="button primary">Sign-in</button>
          </li>
          <li>
            New to thefrockboutique?
          </li>
          <li>
            <Link to="register" className="button full-width">Register on thefrockboutique</Link>
          </li>
        </ul>
      </form>
    </div>
  );
}
export default SigninScreen;
